const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <p>{`尽管默认情况下 v1.6 提供的服务将无法在 Rancher v2.x 中运行，但这并不意味着您必须重新开始在 v2.x 中手动重建应用程序。为了帮助从 v1.6 迁移到 v2.x，Rancher 开发了一个迁移工具。迁移工具 CLI 是一个实用程序，可帮助您在 Rancher v2.x 中重新创建应用程序。该工具将您的 Rancher v1.6 服务导出为 Compose 文件，并将它们转换为 Rancher v2.x 可以使用的 Kubernetes 清单。`}</p>
    <p>{`此外，对于 Kubernetes 无法使用的每个特定于 Rancher v1.6 的 Compose 指令，迁移工具 CLI 均提供了有关如何在 Rancher v2.x 中手动重新创建它们的说明。`}</p>
    <p>{`此命令行界面工具将：`}</p>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`导出 v1.6 Cattle 环境中每个堆栈的 Compose 文件（即`}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{`和`}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{`）。对于每个堆栈，文件都将导出到一个唯一的文件夹： `}<inlineCode parentName="p">{`<EXPORT_DIR>/<ENV_NAME>/<STACK_NAME>`}</inlineCode>{`。`}</p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`解析从 Rancher v1.6 堆栈导出的 Compose 文件并将其转换为 Rancher v2.x 可以使用的 Kubernetes 清单。该工具还会输出无法自动转换为 Rancher v2.x 的 Compose 文件中存在的指令列表。这些是您必须使用 Rancher v2.x UI 手动配置的指令。`}</p>
      </li>
    </ul>
    <h2 {...{
      "id": "1-下载迁移工具-cli"
    }}>{`1. 下载迁移工具 CLI`}</h2>
    <p>{`可以下载适用于您平台的迁移工具 CLI 从我们的`}<a parentName="p" {...{
        "href": "https://github.com/rancher/migration-tools/releases"
      }}>{`GitHub 发布页面`}</a>{`. 这些工具可用于 Linux，Mac 和 Windows 平台。`}</p>
    <h2 {...{
      "id": "2-配置迁移工具-cli"
    }}>{`2. 配置迁移工具 CLI`}</h2>
    <p>{`下载迁移工具 CLI 后，将其重命名并使其可执行。`}</p>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`打开一个终端窗口，然后进入到包含迁移工具文件的目录。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`将文件重命名为`}<inlineCode parentName="p">{`migration-tools`}</inlineCode>{`，使其不再包含平台名称。`}</p>
      </li>
      <li parentName="ol">
        <p parentName="li">{`输入以下命令以使 `}<inlineCode parentName="p">{`migration-tools`}</inlineCode>{` 可执行：`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`chmod +x migration-tools
`}</code></pre>
      </li>
    </ol>
    <h2 {...{
      "id": "3-运行迁移工具-cli"
    }}>{`3. 运行迁移工具 CLI`}</h2>
    <p>{`接下来，使用迁移工具 CLI 将所有 Cattle 环境中的所有堆栈导出到 Compose 文件中。然后，对于要迁移到 Rancher v2.x 的堆栈，将 Compose 文件转换为 Kubernetes 清单。`}</p>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`先决条件:`}</strong>{` 创建一个 Account API Key 使用迁移工具 CLI 时使用 Rancher v1.6 进行身份验证。`}</p>
    </blockquote>
    <ol>
      <li parentName="ol">
        <p parentName="li">{`从 Rancher v1.6 导出适用于 Cattle 环境和堆栈的 Docker Compose 文件。`}</p>
        <p parentName="li">{`在终端窗口中，执行以下命令，将每个占位符替换为您的值。`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`migration-tools export --url http://<RANCHER_URL:PORT> --access-key <RANCHER_ACCESS_KEY> --secret-key <RANCHER_SECRET_KEY> --export-dir <EXPORT_DIR> --all
`}</code></pre>
        <p parentName="li"><strong parentName="p">{`步骤结果:`}</strong>{` 迁移工具导出`}<inlineCode parentName="p">{`--export-dir`}</inlineCode>{`目录中每个堆栈的 Compose 文件（`}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{`和`}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{`）。如果省略此选项，则 Compose 文件将输出到当前目录。`}</p>
        <p parentName="li">{`为每个环境和堆栈创建一个唯一的目录。例如，如果我们从 Rancher v1.6 中导出每个`}<a parentName="p" {...{
            "href": "/docs/rancher2/v1.6-migration/_index"
          }}>{`环境/堆栈`}</a>{`，则创建以下目录结构：`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`export/                            # migration-tools --export-dir
|--<ENVIRONMENT>/                  # Rancher v1.6 ENVIRONMENT
    |--<STACK>/                    # Rancher v1.6 STACK
         |--docker-compose.yml     # STANDARD DOCKER DIRECTIVES FOR ALL STACK SERVICES
         |--rancher-compose.yml    # RANCHER-SPECIFIC DIRECTIVES FOR ALL STACK SERVICES
         |--README.md              # README OF CHANGES FROM v1.6 to v2.x
`}</code></pre>
      </li>
      <li parentName="ol">
        <p parentName="li">{`将导出的 Compose 文件转换为 Kubernetes 清单。`}</p>
        <p parentName="li">{`执行以下命令，将每个占位符替换为堆栈的 Compose 文件的绝对路径。如果要迁移多个堆栈，则必须为导出的每对 Compose 文件重新运行该命令。`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`migration-tools parse --docker-file <DOCKER_COMPOSE_ABSOLUTE_PATH> --rancher-file <RANCHER_COMPOSE_ABSOLUTE_PATH>
`}</code></pre>
        <blockquote parentName="li">
          <p parentName="blockquote"><strong parentName="p">{`注意:`}</strong>{` 如果您从命令中省略了`}<inlineCode parentName="p">{`--docker-file`}</inlineCode>{`和 `}<inlineCode parentName="p">{`--rancher-file`}</inlineCode>{`选项，则迁移工具将使用当前工作目录来查找 Compose 文件。`}</p>
        </blockquote>
      </li>
    </ol>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`想要迁移工具 CLI 的完整用法和选项?`}</strong>{` 查看 `}<a parentName="p" {...{
          "href": "/docs/rancher2/v1.6-migration/run-migration-tool/migration-tools-ref/_index"
        }}>{`迁移工具 CLI 参考文档`}</a>{`。`}</p>
    </blockquote>
    <h3 {...{
      "id": "迁移工具-cli-的输出"
    }}>{`迁移工具 CLI 的输出`}</h3>
    <p>{`运行 migration-tools parse 命令后，以下文件将输出到目标目录。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`输出`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`output.txt`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该文件列出了如何在 Kubernetes 中重新创建特定于 Rancher v1.6 的功能。每个清单都链接到有关如何在 Rancher v2.x 中实现它的相关博客文章。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`Kubernetes 清单文件`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`迁移工具在内部调用 `}<a parentName="td" {...{
              "href": "https://github.com/kubernetes/kompose"
            }}>{`Kompose`}</a>{` 为您要迁移到 v2.x 的每个服务生成 Kubernetes 清单。每个 YAML Spec 文件均以您要迁移的服务命名。`}</td>
        </tr>
      </tbody>
    </table>
    <h4 {...{
      "id": "为什么会有单独的部署和服务清单"
    }}>{`为什么会有单独的部署和服务清单?`}</h4>
    <p>{`为了使应用程序可以通过 URL 公开访问，需要 Kubernetes 服务来支持部署。Kubernetes 服务是一个 REST 对象，它抽象化了对工作负载中 Pod 的访问。换句话说，服务通过将 URL 映射到一个或多个 pod 来为 pod 提供一个静态端点。因此，即使 pod 更改了 IP 地址，公共端点也保持不变。服务对象使用选择器标签指向其相应的部署（工作负载）。`}</p>
    <p>{`当您从 Rancher v1.6 导出公共端口的服务时，迁移工具 CLI 会将这些端口解析为 Kubernetes 服务 Spec 文件，该 Spec 文件会关联到部署 Spec 文件。`}</p>
    <h4 {...{
      "id": "迁移示例文件输出"
    }}>{`迁移示例文件输出`}</h4>
    <p>{`如果我们从`}<a parentName="p" {...{
        "href": "/docs/rancher2/v1.6-migration/_index"
      }}>{`迁移示例文件`}</a>{`中解析两个示例文件`}<inlineCode parentName="p">{`docker-compose.yml`}</inlineCode>{`和`}<inlineCode parentName="p">{`rancher-compose.yml`}</inlineCode>{`，则以下文件输出：`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`文件`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`描述`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`web-deployment.yaml`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`包含用于 Let's Chat 部署的 Kubernetes 容器 Spec 的文件。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`web-service.yaml`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`包含 Let's Chat 服务 Spec 的文件。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`database-deployment.yaml`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`该文件包含用于支持 Let's Chat 的 MongoDB 部署的容器 Spec。`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`webLB-deployment.yaml`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`包含用于充当负载均衡器的 HAProxy 部署的容器 Spec 的文件.`}<sup>{`1`}</sup></td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}><inlineCode parentName="td">{`webLB-service.yaml`}</inlineCode></td>
          <td parentName="tr" {...{
            "align": null
          }}>{`包含 HAProxy 服务 Spec 的文件。`}<sup>{`1`}</sup></td>
        </tr>
      </tbody>
    </table>
    <blockquote>
      <sup>1</sup> 由于 Rancher v2.x 使用 Ingress 进行负载均衡，因此我们不会将 Rancher v1.6 负载均衡器迁移到 v2.x。
    </blockquote>
    <h2 {...{
      "id": "4-以-kubernetes-清单的形式重新部署服务"
    }}>{`4. 以 Kubernetes 清单的形式重新部署服务`}</h2>
    <blockquote>
      <p parentName="blockquote"><strong parentName="p">{`注意:`}</strong>{` 尽管这些说明将您的 v1.6 服务部署在 Rancher v2.x 中，但在您调整 Kubernetes 清单之前，它们将无法正常工作。`}</p>
    </blockquote>
    <ul>
      <li parentName="ul">
        <p parentName="li">{`通过 Rancher UI 部署`}</p>
        <p parentName="li">{`您可以通过将迁移工具创建的 Kubernetes 清单导入 Rancher v2.x 来进行部署。`}</p>
        <blockquote parentName="li">
          <p parentName="blockquote"><strong parentName="p">{`接收到 `}<inlineCode parentName="strong">{`ImportYaml Error`}</inlineCode>{`?`}</strong></p>
          <p parentName="blockquote">{`删除错误消息中列出的 YAML 指令。这些是 Kubernetes 无法读取的来自 v1.6 服务的 YAML 指令。`}</p>
        </blockquote>
        <figcaption>部署服务：导入 Kubernetes 清单</figcaption>
        <p parentName="li"><img parentName="p" {...{
            "src": "/img/rancher/deploy-service.gif",
            "alt": "部署服务"
          }}></img></p>
      </li>
      <li parentName="ul">
        <p parentName="li">{`通过 Rancher CLI 部署`}</p>
        <blockquote parentName="li">
          <p parentName="blockquote"><strong parentName="p">{`先决条件:`}</strong>{` 为 Rancher v2.x `}<a parentName="p" {...{
              "href": "/docs/rancher2/cli/_index"
            }}>{`安装 Rancher CLI`}</a></p>
        </blockquote>
        <p parentName="li">{`使用以下 Rancher CLI 命令让 Rancher v2.x 部署应用程序。对于迁移工具 CLI 输出的每个 Kubernetes 清单，请输入以下命令之一，以将其导入 Rancherv2.x。`}</p>
        <pre parentName="li"><code parentName="pre" {...{}}>{`./rancher kubectl create -f <DEPLOYMENT_YAML_FILE> # DEPLOY THE DEPLOYMENT YAML

./rancher kubectl create -f <SERVICE_YAML_FILE> # DEPLOY THE SERVICE YAML
`}</code></pre>
      </li>
    </ul>
    <p>{`导入后，您可以使用上下文菜单选择包含服务的`}<inlineCode parentName="p">{`<集群> > <项目>`}</inlineCode>{`，从而在 Kubernetes 清单中以 v2.x UI 形式查看 v1.6 服务。导入的清单将显示在`}<strong parentName="p">{`资源 > 工作负载`}</strong>{`以及`}<strong parentName="p">{`资源 > 工作负载 > 服务发现`}</strong>{`的选项卡上。（在 v2.3.0 之前的 Rancher v2.x 中，这些文件在`}<strong parentName="p">{`工作负载`}</strong>{`和顶部导航栏中的`}<strong parentName="p">{`服务发现`}</strong>{`标签上。）`}</p>
    <figcaption>导入的服务</figcaption>
    <p><img parentName="p" {...{
        "src": "/img/rancher/imported-workloads.png",
        "alt": "导入服务"
      }}></img></p>
    <h2 {...{
      "id": "现在怎么做"
    }}>{`现在怎么做?`}</h2>
    <p>{`尽管迁移工具 CLI 将您的 Rancher v1.6 Compose 文件解析为 Kubernetes 清单，但是您必须通过手动编辑已解析的 Kubernetes 清单，来解决 v1.6 和 v2.x 之间的差异。换句话说，您需要编辑刚刚导入到 Rancher v2.x 中的每个工作负载和服务，如下所示。`}</p>
    <figcaption>编辑迁移后的服务</figcaption>
    <p><img parentName="p" {...{
        "src": "/img/rancher/edit-migration-workload.gif",
        "alt": "编辑迁移的工作负载"
      }}></img></p>
    <p>{`如`}<a parentName="p" {...{
        "href": "#%E8%BF%81%E7%A7%BB%E5%B7%A5%E5%85%B7-cli-%E7%9A%84%E8%BE%93%E5%87%BA"
      }}>{`迁移工具 CLI 输出`}</a>{`中所述，解析过程中生成的 output.txt 文件列出了每个部署必须执行的手动步骤。查看接下来的议题，以获取有关手动编辑 Kubernetes Spec 的更多信息。`}</p>
    <p>{`打开您的`}<inlineCode parentName="p">{`output.txt`}</inlineCode>{`文件并查看其内容。将 Compose 文件解析为 Kubernetes 清单时，迁移工具 CLI 会为其 Kubernetes 创建的每个工作负载输出清单。例如，当我们将`}<a parentName="p" {...{
        "href": "/docs/rancher2/v1.6-migration/_index"
      }}>{`迁移示例文件`}</a>{`解析为 Kubernetes 清单时，`}<inlineCode parentName="p">{`output.txt`}</inlineCode>{`列出了每个解析后的 Kubernetes 清单文件（即工作负载）。每个工作负载均具有一系列 Action，以在 v2.x 中还原该工作负载的功能。`}</p>
    <figcaption>Output.txt 示例</figcaption>
    <p><img parentName="p" {...{
        "src": "/img/rancher/output-dot-text.png",
        "alt": "output.txt"
      }}></img></p>
    <p>{`下表列出了可能在`}<inlineCode parentName="p">{`output.txt`}</inlineCode>{`中出现的指令和它们的含义以及有关如何解决它们的链接。`}</p>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`指令`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`指导`}</th>
        </tr>
      </thead>
